// src/components/Auth.js
import React, { useState } from 'react';
import { supabase } from '../supabaseClient';

function Auth() {
  const [loading, setLoading] = useState(false);
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [isSignUp, setIsSignUp] = useState(false);

  const handleAuth = async (event) => {
    event.preventDefault();
    const cleanedEmail = email.trim();
    const cleanedPassword = password.trim();

    if (!cleanedEmail || !cleanedPassword) {
      alert("Email and password are required");
      return;
    }

    // Basic frontend password policy hint (can be aligned with Supabase project settings)
    if (isSignUp && cleanedPassword.length < 6) {
      alert("Password must be at least 6 characters long.");
      return;
    }

    setLoading(true);
    let authError = null;
    let authData = null;

    if (isSignUp) {
      // Sign Up
      const { data, error } = await supabase.auth.signUp({
        email: cleanedEmail,
        password: cleanedPassword,
        options: {
          emailRedirectTo: window.location.origin, // Adjust if you have a custom confirmation route
          data: { app_role: 'user' },
        },
      });
      authError = error;
      authData = data;
    } else {
      // Sign In
      const { data, error } = await supabase.auth.signInWithPassword({
        email: cleanedEmail,
        password: cleanedPassword,
      });
      authError = error;
      authData = data;
    }

    if (authError) {
      console.group("Auth Error");
      console.error("Status:", authError.status);
      console.error("Message:", authError.message);
      console.error("Full error object:", authError);
      console.groupEnd();

      // Provide more user-friendly mapping for common 400 issues
      let friendly = authError.message;
      if (/signup/i.test(authError.message) && /disabled|not allowed/i.test(authError.message)) {
        friendly = "Sign ups are disabled for this project. Enable 'Email: Enable Signups' in Supabase Auth settings.";
      } else if (/password/i.test(authError.message) && /length|complex/i.test(authError.message)) {
        friendly = "Password does not meet the configured policy. Try a longer / more complex password.";
      } else if (/Email rate limit|rate limit/i.test(authError.message)) {
        friendly = "Too many attempts. Please wait a minute before trying again.";
      } else if (/already registered|User already registered/i.test(authError.message)) {
        friendly = "This email is already registered. Try signing in instead.";
      }
      alert(friendly);
    } else {
      if (isSignUp) {
        console.log("Sign up data:", authData);
        alert('Registration successful! Please check your email inbox to confirm your account.');
      } else {
        console.log("Sign in data:", authData);
        alert('Signed in successfully!');
      }
    }

    setLoading(false);
  };

  return (
    <div style={authContainerStyle}>
      <h1 style={headingStyle}>Automated Shopping Agent</h1>
      <p style={subheadingStyle}>
        {isSignUp ? 'Create your account to get started' : 'Sign in to use the shopping agent'}
      </p>
      <form onSubmit={handleAuth} style={formStyle}>
        <div style={inputGroupStyle}>
          <label htmlFor="email" style={labelStyle}>Email:</label>
          <input
            id="email"
            type="email"
            placeholder="Your email"
            value={email}
            onChange={(e) => setEmail(e.target.value)}
            style={inputStyle}
            required
            autoComplete="email"
          />
        </div>
        <div style={inputGroupStyle}>
          <label htmlFor="password" style={labelStyle}>Password:</label>
          <input
            id="password"
            type="password"
            placeholder="Your password"
            value={password}
            onChange={(e) => setPassword(e.target.value)}
            style={inputStyle}
            required
            minLength={6}
            autoComplete="current-password"
          />
        </div>
        <button
          type="submit"
          style={{ ...buttonStyle, backgroundColor: '#3b82f6', opacity: loading ? 0.6 : 1 }}
          disabled={loading}
        >
          {loading ? 'Loading...' : (isSignUp ? 'Sign Up' : 'Sign In')}
        </button>
      </form>
      <p style={toggleTextStyle}>
        {isSignUp ? "Already have an account?" : "Don't have an account?"}
        <button
          onClick={() => setIsSignUp(!isSignUp)}
          style={toggleButtonStyle}
        >
          {isSignUp ? 'Sign In' : 'Sign Up'}
        </button>
      </p>
    </div>
  );
}

// --- Inline Styles ---
const authContainerStyle = {
  minHeight: '100vh',
  backgroundColor: '#f3f4f6',
  padding: '2rem',
  fontFamily: 'sans-serif',
  display: 'flex',
  flexDirection: 'column',
  alignItems: 'center',
  justifyContent: 'center',
};

const headingStyle = {
  fontSize: '2.25rem',
  fontWeight: '800',
  color: '#111827',
  marginBottom: '1rem',
  textAlign: 'center',
};

const subheadingStyle = {
  fontSize: '1.25rem',
  color: '#4b5563',
  marginBottom: '2rem',
  textAlign: 'center',
};

const formStyle = {
  backgroundColor: '#ffffff',
  boxShadow: '0 4px 6px rgba(0,0,0,0.1)',
  borderRadius: '0.75rem',
  padding: '2rem',
  width: '100%',
  maxWidth: '400px',
  display: 'flex',
  flexDirection: 'column',
  gap: '1rem',
};

const inputGroupStyle = {
  display: 'flex',
  flexDirection: 'column',
  gap: '0.5rem',
};

const labelStyle = {
  fontSize: '1rem',
  fontWeight: '600',
  color: '#374151',
};

const inputStyle = {
  padding: '0.75rem',
  border: '1px solid #d1d5db',
  borderRadius: '0.5rem',
  outline: 'none',
  fontSize: '1rem',
};

const buttonStyle = {
  padding: '0.75rem 1.5rem',
  color: '#ffffff',
  fontWeight: 'bold',
  fontSize: '1rem',
  borderRadius: '0.5rem',
  border: 'none',
  cursor: 'pointer',
  transition: 'background-color 0.2s ease-in-out, opacity 0.2s ease-in-out',
};

const toggleTextStyle = {
  marginTop: '1.5rem',
  fontSize: '0.875rem',
  color: '#4b5563',
};

const toggleButtonStyle = {
  backgroundColor: 'transparent',
  border: 'none',
  color: '#3b82f6',
  fontWeight: '600',
  cursor: 'pointer',
  marginLeft: '0.25rem',
  textDecoration: 'underline',
  fontSize: '0.875rem',
};

export default Auth;
